    alignItems: "center",
    width: "100vw",
    height: "50vh",
  };

  return (
    <div style={styleNoResultDiv}>
      <iframe
        title="sad"
        src="https://giphy.com/embed/BEob5qwFkSJ7G"
        width="480"
        height="355"
        frameBorder="0"
        class="giphy-embed"
        allowFullScreen
      ></iframe>
      <p>
        <a href="https://giphy.com/gifs/spongebob-squarepants-sad-crying-BEob5qwFkSJ7G">
          via GIPHY
        </a>
      </p>
      <h1>No Result Found !!</h1>
    </div>
  );
}

export default NoResult;
